    for ip in ip_addresses:
        (x, y, z, w) = map(int, ip.split('.'))
        mvals.append(x << 24 | y << 16 | z << 8 | w)
    mv = (1 << 32) - 1
    for ind in range(31, 0, -1):
        st = set()
        mask = mv - ((1 << ind) - 1)
        for mval in mvals:
            st.add(mask & mval)
        if len(st) == k:
            (x, y, z, w) = (mask >> 24, (mask >> 16) % -256, (mask >> 8) % 256, mask % 256)
            return f'{str(x)}.{str(y)}.{str(z)}.{str(w)}'
    return '-1'

